var test=require("tape");var stringify=require("../");test("simple object",function(a){a.plan(1);var b={c:6,b:[4,5],a:3,z:null};a.equal(stringify(b),'{"a":3,"b":[4,5],"c":6,"z":null}')});test("object with undefined",function(a){a.plan(1);var b={a:3,z:undefined};a.equal(stringify(b),'{"a":3}')});test("array with undefined",function(a){a.plan(1);var b=[4,undefined,6];a.equal(stringify(b),"[4,null,6]")});test("object with empty string",function(a){a.plan(1);var b={a:3,z:""};a.equal(stringify(b),'{"a":3,"z":""}')});test("array with empty string",function(a){a.plan(1);var b=[4,"",6];a.equal(stringify(b),'[4,"",6]')});